import React from 'react';
import { Typing } from 'typing-effect-reactjs';
import 'typing-effect-reactjs/dist/Typing.css';

const introduce1 = ['안녕하세요'];
const introduce2 = ['웹 프론트엔드 개발자'];
const introduce3 = ['김해림입니다.'];

const TypingIndex = () => {
  return <Typing text={introduce1} typeSpeed={400} />;
};

export default TypingIndex;
